---
openapi: 3.0.1
info:
  title: Transfer Service
  description: The Transfer service supports operations related to managing the transfer of money between accounts. The service includes the description of the FROM and TO accounts, amount of the transfer, transfer fees and frequency of the transfer as it can be a one-time transfer or a recurring transfer.
  version: 11.0.0_PRM
servers:
  - url: https://bankinghub-cert-fiservapis.azure-api.net/transfer-service
paths:
  /banking/efx/v1/xferservice/payments/transfers:
    put:
      tags:
        - Transfer Service
      summary: Update Transfer
      description: Update Transfer API modifies the information on an existing scheduled transfer (one time or recurring)
      operationId: XferModOper
      security:
        - OAuth2ClientCredentials: []
      parameters:
        - name: EFXHeader
          in: header
          schema:
            type: string
          example: '{"OrganizationId":"999990300","TrnId":"123"}'
      requestBody:
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/XferModOperRequest'
      responses:
        '200':
          description: Success
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/XferModOperResponse'
        default:
          description: Default Response for the Update Transfer request.
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/XferModOperResponse'
      x-default-example: Premier
      x-group-name: Transfer Service
      x-proxy-name: Update Transfer
      x-child-product-name: Transfers
      x-core: Premier
    post:
      tags:
        - Transfer Service
      summary: Add Transfer
      description: Add Transfer API creates the request for an automatic transfer of funds between two accounts. <br> For Premier, this API supports future dated transfers on the core and includes the FROM and TO accounts, descriptions and the frequency of the transfer which can be a one-time transfer or a recurring transfer
      operationId: XferAddOper
      security:
        - OAuth2ClientCredentials: []
      parameters:
        - name: EFXHeader
          in: header
          schema:
            type: string
          example: '{"OrganizationId":"999990300","TrnId":"123"}'
      requestBody:
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/XferAddOperRequest'
      responses:
        '201':
          description: Created
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/XferAddOperResponse'
        default:
          description: Default Response for the Add Transfer request.
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/XferAddOperResponse'
      x-default-example: Premier
      x-group-name: Transfer Service
      x-proxy-name: Add Transfer
      x-child-product-name: Transfers
      x-core: Premier
  /banking/efx/v1/xferservice/payments/transfers/secured:
    put:
      tags:
        - Transfer Service
      summary: Delete Transfer
      description: Delete Transfer API deletes the existing scheduled (one time or recurring) transfer of funds from the core
      operationId: SecuredXferDelOper
      security:
        - OAuth2ClientCredentials: []
      parameters:
        - name: EFXHeader
