      x-group-name: Transfer Service
      x-proxy-name: Delete Transfer
      x-child-product-name: Transfers
      x-core: Premier
    post:
      tags:
        - Transfer Service
      summary: Get Transfer
      description: Get Transfer API retrieves the information about one specific scheduled transfer (one time or recurring) from the core, based on the unique transfer identifier sent in the request.
