            - Monthly
            - TwiceMonthly
            - Quarterly
            - Yearly
            - Weekly
            - Once
            - Maturity
          example: 'Weekly'
        RecurInterval:
          type: integer
          example: 2
          description: "Recurrence interval between two successive occurrences of transfer.\n\n\n\nFor example, if the recurrence type value is set to 'Monthly' and the recurrence interval set to '1', then there will be a 1-month interval between the next statement.\n\n\n\nThe default value is set to 1.\n\n\n\n**Note:** Premier uses the Recur Interval with the Recur Type to determine the transfer frequency.  \n\n\n\n\n\n\n\nUse the following options:\n\n\n\n- If the recurrence type value is once, no interval value is required\n\n\n\n- If the recurrence type value is month, interval use values \"1 \" for Monthly, \"3\" for Quarterly, \"2\" for BiMonthly or \"6\" for SemiAnnually intervals\n\n\n\nAlso: \n\n\n\n- For Recurrence Type value based on a quarter can also be expressed using \"1\" for Quarterly.\n\n\n\n- For Recurrence Type  based on weeks, use this field to express \"1\"  for Weekly or \"2\" for BiWeekly.\n\n\n\n- For Recurrence Type based on years, use the value \"1\"  for Yearly.\n\n\n\n- For Recurrence Type values based on twice monthly use \"1\" for TwiceMonthly.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n"
          format: int64
