          $ref: '#/components/schemas/SecuredXferInqOperResponse_XferInfo'
        XferStatus:
          $ref: '#/components/schemas/SecuredXferDelOperResponse_XferStatusRec_XferStatus'
    XferListInqRequest_XferListSel_AcctRef:
      required:
        - AcctKeys
      type: object
      properties:
        AcctKeys:
          $ref: '#/components/schemas/SecuredXferDelOperRequest_XferKeys_AcctKeys'
      description: Reference information of an account object involved in the transfer.
    XferListInqRequest_XferListSel:
      type: object
      properties:
        AcctRef:
          $ref: '#/components/schemas/XferListInqRequest_XferListSel_AcctRef'
      description: Selection criteria to retrieve the transfer list record.
    XferListInqResponse_RecCtrlOut:
      required:
        - SentRecCount
