          enum:
            - 1-999
      description: |-
        Information retrieved for the criteria specified in the RecCtrlIn aggregate of the request message.







        **Note:** Service provider does not support record control for transfer list inquiry. Up to 999 transfer records can be returned in the response. All transfer addendums available on the account will be returned on the response.
    XferListInqResponse_XferKeys:
      required:
        - AcctKeys
