      properties:
        AcctKeys:
          $ref: '#/components/schemas/SecuredXferDelOperRequest_XferKeys_AcctKeys'
        XferIdent:
          type: string
          description: |-
            Unique identifier of a transfer record.



            **Note:** Refers to addenda number.
          enum:
            - 1-999
        TransferType:
          type: string
          description: Type of transfer.
      description: Unique information to identify the transaction record.
    XferListInqResponse_XferListInfo_ToAcctRef_AcctKeys:
      required:
        - AcctId
      type: object
      properties:
        AcctId:
          maxLength: 36
          type: string
          description: |+
            Unique identification number of an account record.











        AcctType:
          type: string
          description: |-
            Type of an account.
          enum:
            - DDA
            - SDA
            - EXT
            - LOAN
            - SDB
            - GLA
      description: Unique information to identify the account record.
    XferListInqResponse_XferListInfo_ToAcctRef:
      required:
        - AcctKeys
      type: object
      properties:
        AcctKeys:
          $ref: '#/components/schemas/XferListInqResponse_XferListInfo_ToAcctRef_AcctKeys'
      description: Reference information of an account to which funds are transferred.
    XferListInqResponse_XferListInfo_CurAmt_CurCode:
      required:
        - CurCodeValue
      type: object
      properties:
        CurCodeType:
          type: string
          description: Standard ISO currency code format.
          enum:
            - ISO4217-Alpha
        CurCodeTypeEnumDesc:
          maxLength: 80
          type: string
          description: Description of the enumeration value in the CurCodeType field.
        CurCodeValue:
          type: string
          description: "Currency code value as per the ISO currency code format set in the CurCodeType field.\n\n\n\nFor example, the currency code for the US Dollar in alpha and numeric formats are:\n\n\n\n- USD (in ISO4217-Alpha format) \n\n\n\n- 840 (in ISO4217-Numeric format)\n\n\n\n\n\n\n\nPresently only the USD currency code is supported."
      description: Details of currency code.
    XferListInqResponse_XferListInfo_CurAmt:
      type: object
      properties:
        Amt:
          type: number
          description: Amount in decimal format.
        CurCode:
          $ref: '#/components/schemas/XferListInqResponse_XferListInfo_CurAmt_CurCode'
      description: Details of the amount to be transferred.
    XferListInqResponse_XferListInfo_RecurModel_RecurRule:
      properties:
        RecurType:
          type: string
          description: Type of payment cycle.
          enum:
            - Cycle
            - Monthly
            - Quarterly
            - Yearly
            - Weekly
            - TwiceMonthly
            - Once
            - InterestCycle
            - Maturity
        RecurInterval:
          type: integer
          description: |-
            Recurrence interval between two successive occurrences of transfer.



            For example, if the recurrence type value is set to 'Monthly' and the recurrence interval set to '1', then there will be a 1-month interval between the next statement.



            The default value is set to 1.
          format: int64
    XferListInqResponse_XferListInfo_RecurModel:
      type: object
      properties:
        RecurRule:
          type: array
          description: Details of the recurrence rule.
          items:
            $ref: '#/components/schemas/XferListInqResponse_XferListInfo_RecurModel_RecurRule'
      description: Details of a recurring time-based payment module for an automatic transfer of funds.
    XferListInqResponse_XferListInfo:
      required:
        - CurAmt
      type: object
      properties:
        FromAcctRef:
          $ref: '#/components/schemas/SecuredXferInqOperResponse_XferInfo_FromAcctRef'
        ToAcctRef:
          $ref: '#/components/schemas/XferListInqResponse_XferListInfo_ToAcctRef'
        CurAmt:
          $ref: '#/components/schemas/XferListInqResponse_XferListInfo_CurAmt'
        StartDt:
          pattern: '[0-9]{4}-[0-9]{2}-[0-9]{2}(T[0-9]{2}:[0-9]{2}(:[0-9]{2}(\.[0-9]{3})?((-|\+)[0-9]{2}:[0-9]{2})?)?)?'
          type: string
          description: |-
            Start date and time of the fund transfer.



            Format: yyyy-MM-ddTHH:mm:ss.sss



            Example: 2021-01-31T23:59:59.999
        EndDt:
          pattern: '[0-9]{4}-[0-9]{2}-[0-9]{2}(T[0-9]{2}:[0-9]{2}(:[0-9]{2}(\.[0-9]{3})?((-|\+)[0-9]{2}:[0-9]{2})?)?)?'
          type: string
          description: |-
            End date and time value of the fund transfer.



            Format: yyyy-MM-ddTHH:mm:ss.sss



            Example: 2021-01-31T23:59:59.999
        RecurModel:
          $ref: '#/components/schemas/XferListInqResponse_XferListInfo_RecurModel'
        XferAmtCode:
          type: string
          description: |-
            Code that indicates whether the next transfer amount is fixed or variable.



            **Note:** Refers to transfer amount code.
          enum:
            - Fixed
            - Variable
            - IntPlusDistribution
            - BalanceMinusDistribution
        Nickname:
          maxLength: 80
          type: string
          description: Name that customer can assign for easy identification.
        XferStatusType:
          type: string
          description: Type of the transfer status.
          enum:
            - Active
            - Pending
      description: Details of the funds transfer.
    XferListInqResponse_XferStatus:
      required:
        - XferStatusCode
      type: object
      properties:
        XferStatusCode:
          type: string
          description: Code to identify the status of the transfer.
          enum:
            - Valid
        EffDt:
          pattern: '[0-9]{4}-[0-9]{2}-[0-9]{2}(T[0-9]{2}:[0-9]{2}(:[0-9]{2}(\.[0-9]{3})?((-|\+)[0-9]{2}:[0-9]{2})?)?)?'
          type: string
          description: |+
            Effective date and time when transfer status is changed.







            Format: yyyy-MM-ddTHH:mm:ss.sss



            Example: 2021-01-31T23:59:59.999







      description: Current status of the transfer.
    XferListInqResponse_XferListRec:
      required:
        - XferKeys
        - XferListInfo
        - XferStatus
      properties:
        XferKeys:
          $ref: '#/components/schemas/XferListInqResponse_XferKeys'
        XferListInfo:
          $ref: '#/components/schemas/XferListInqResponse_XferListInfo'
        XferStatus:
          $ref: '#/components/schemas/XferListInqResponse_XferStatus'
    XferModOperRequest_XferKeys:
      required:
        - AcctKeys
      type: object
      properties:
        AcctKeys:
          $ref: '#/components/schemas/SecuredXferDelOperRequest_XferKeys_AcctKeys'
        XferIdent:
          maxLength: 36
          type: string
          example: '45'
          description: |-
            Unique identifier of a transfer record.
            **Note:** Refers to addenda number.
      description: |-
        Unique information to identify the transaction record.
        **Note:** Transfer identifier for the service provider is a combination of the account number that is used to debit the account for the transfer, account type and addenda number.
    XferModOperRequest_XferInfo_FromAcctRef_AcctKeys:
      required:
        - AcctId
      type: object
      properties:
        AcctId:
          maxLength: 36
          type: string
          example: '1082601164'
          description: |-
            Unique identification number of an account record.
            **Note:** Debit account number cannot be updated. Debit account number is part of the transfer identifier. If a different debit account number needs to be used for the transfer, new transfer request needs to be created using the desired debit account number as part of the transfer identifier.
        AcctType:
          type: string
          description: |-
            Type of an account.
          enum:
            - DDA
            - SDA
            - CDA
          example: 'DDA'
      description: Unique information to identify the account record.
    XferModOperRequest_XferInfo_FromAcctRef:
      required:
        - AcctKeys
      type: object
      properties:
        AcctKeys:
          $ref: '#/components/schemas/XferModOperRequest_XferInfo_FromAcctRef_AcctKeys'
      description: Reference account information from which the funds are transferred.
    XferModOperRequest_XferInfo_ToAcctRef_AcctKeys_AcctIdent:
      type: object
      properties:
        AcctIdentType:
          type: string
          description: Type of account identifiers to identify the external transfer account.
          enum:
            - AcctTypeCode
        AcctIdentValue:
          type: string
          description: |+
            Value to identify the type of external transfer account.
            **Note:** Refers to external transfer account type. Required if the credit to account type is external.
            Valid values for DDA:
            - 0 = None
            - 1 = Demand Deposit
            - 2 = Savings
            - 3 = Vendor (BPM)
            - 4 = Loan
            Valid values for SDA:
            - 0 = None
            - 1 = Demand Deposit
            - 2 = Savings
            - 3 = Vendor (BPM)
            - 4 = Loan
            - 9 =Check
            Valid values for CDA:
            - 0 = None
            - 1 = Demand Deposit
            - 2 = Savings
            - 9 =Check
          enum:
            - '0'
            - '1'
            - '2'
            - '3'
            - '4'
            - '9'
      description: Unique identifier of an account record used in case of external transfers.
    XferModOperRequest_XferInfo_ToAcctRef_AcctKeys:
      required:
        - AcctId
      type: object
      properties:
        AcctId:
          maxLength: 36
          type: string
          example: '1082073267'
          description: Unique identification number of an account.
        AcctType:
          type: string
          description: |-
            Type of an account.
          enum:
            - DDA
            - SDA
            - EXT
            - LOAN
            - SDB
            - GLA
          example: 'DDA'
        AcctIdent:
          type: array
          items:
            $ref: '#/components/schemas/XferModOperRequest_XferInfo_ToAcctRef_AcctKeys_AcctIdent'
          example:
            - AcctIdentType: AcctTypeCode
              AcctIdentValue: '0'
        FIIdentType:
          type: array
          items:
            description: |-
              Identification type of a financial institution.
              **Note:** Provider uses financial institution identification type for routing numbers.
          example:
            - RoutingNum
        FIIdent:
          type: array
          items:
            description: "Unique identification number of a financial institution. \n\n\n\n**Note:** *Conditionally Required field*\n\n\n\nRequired if the To account type is external."
          example:
            - '0'
      description: Unique account information used to identify the account record.
    XferModOperRequest_XferInfo_ToAcctRef:
      required:
        - AcctKeys
      type: object
      properties:
        AcctKeys:
          $ref: '#/components/schemas/XferModOperRequest_XferInfo_ToAcctRef_AcctKeys'
      description: Reference information of an account to which funds are transferred.
    XferModOperRequest_XferInfo_CurAmt_CurCode:
      required:
        - CurCodeValue
      type: object
      properties:
        CurCodeType:
          type: string
          description: Standard ISO currency code format.
          enum:
            - ISO4217-Alpha
          example: 'ISO4217-Alpha'
        CurCodeValue:
          type: string
          example: 'USD'
          description: "Currency code value as per the ISO currency code format set in the CurCodeType field.\n\n\n\nFor example, currency code for the US Dollar in alpha and numeric formats are:\n\n\n\n- USD (in ISO4217-Alpha format) \n\n\n\n- 840 (in ISO4217-Numeric format)\n\n\n\n\n\n\n\nPresently only the USD currency code is supported."
      description: Details of currency code.
    XferModOperRequest_XferInfo_CurAmt:
      type: object
      properties:
        Amt:
          type: number
          description: Amount in decimal format.
          example: 1
        CurCode:
          $ref: '#/components/schemas/XferModOperRequest_XferInfo_CurAmt_CurCode'
      description: Details of the amount to be transferred.
    XferModOperRequest_XferInfo_RecurModel_RecurRule:
      properties:
        RecurType:
          type: string
          description: Type of payment cycle.
          enum:
            - Cycle
            - Monthly
            - Quarterly
            - Yearly
            - Weekly
            - TwiceMonthly
            - Once
            - InterestCycle
            - Maturity
          example: 'Weekly'
        RecurInterval:
          type: integer
          description: "Recurrence interval between two successive occurrences of transfer.\n\n\n\nFor example, if the recurrence type value is set to 'Monthly' and the recurrence interval set to '1', then there will be 1-month interval between the next statement.\n\n\n\nThe default value is set to 1.\n\n\n\n**Note:** Use the following options: \n\n\n\n- If recurrence type is \"Once\", Interest Cycle or Maturity no interval is required\n\n\n\n- If recurrence type based on Cycle use values 001 -999 to express the cycle number \n\n\n\n- If recurrence type based on Months uses values '1' for Monthly, '3' for Quarterly, '2' for BiMonthly or '6' for SemiAnnually\n\n\n\n- If recurrence type based on Quarter use value '1' for Quarterly\n\n\n\n- If recurrence type based on Week use values '1' for Weekly or '2' for BiWeekly\n\n\n\n- If recurrence type based on Year, use value1 for Yearly\n\n\n\n\n\n\n\n \n\n\n\n\n\n\n\n"
          format: int64
          example: 2
        RecurStartDate:
          type: string
          example: '2025-08-06'
        RecurEndDate:
          type: string
          example: '2027-07-07'
          description: |-
            Ending date or expiry date for the recurrence cycle of transfer.







            Format: mm/dd/yyyy.



            Example: 10/20/2021.



            **Note:** This may be used instead of occurrences.
          format: date
    XferModOperRequest_XferInfo_RecurModel:
      type: object
      properties:
        RecurRule:
          type: array
          description: Details of the recurrence rule.
          items:
            $ref: '#/components/schemas/XferModOperRequest_XferInfo_RecurModel_RecurRule'
          example:
            - RecurType: Weekly
              RecurInterval: 2
              RecurStartDate: '2025-08-09'
              RecurEndDate: '2053-10-30'
      description: Details of a recurring time-based payment module for an automatic transfer of funds.
    XferModOperRequest_XferInfo_RelationshipMgr:
      required:
        - RelationshipMgrIdent
      properties:
        RelationshipMgrIdent:
          maxLength: 36
          type: string
          example: '201'
          description: |-
            Unique identifier of a relationship manager.



            **Note:** Refers to responsibility code.



            The client-defined responsibility code identifies the officer responsible for the account. Values are 00000-99999.
        RelationshipRole:
          type: string
          example: 'Officer'
          description: Role of a relationship manager.
          enum:
            - Officer
    XferModOperRequest_XferInfo_ExtendedXferData_NoticeData:
      properties:
        NoticeType:
          type: string
          description: |-
            Information used to identify the type of notice.



            Core can have both regular as well as ACH notice type.



            **Note:** ACHNotice refers to ACH Pre-Note sent flag.



            RegularNotice refers to notification code.
          enum:
            - ACHNotice
            - RegularNotice
          example: 'RegularNotice'
        NoticeOption:
          type: string
          example: 'NoNotice'
          description: Notification code that indicates whether the transfer notification is applicable for the account.
    XferModOperRequest_XferInfo_ExtendedXferData:
      type: object
      properties:
        ACHEntryClass:
          type: string
          description: |-
            Code used to identify the NACHA payment type (standard entry class).



            **Note:** Refers to ACH standard entry class.
          enum:
            - PPD
            - CCD
            - WEB
            - CIE
          example: 'PPD'
        NoticeData:
          type: array
          description: |+
            Details used for notice generation each time when a transfer takes place.
          items:
            $ref: '#/components/schemas/XferModOperRequest_XferInfo_ExtendedXferData_NoticeData'
          example:
            - NoticeType: 'RegularNotice'
              NoticeOption: 'NoNotice'

        ForcePostInd:
          type: boolean
          example: false
          description: |-
            Value to indicate whether to process a transfer using the force pay transaction code.



            **Note:** Refers to force payment.
        FeeIdent:
          maxLength: 36
          type: string
          example: '0'
          description: |-
            Identification code used to identify the fee applicable for a transfer.



            **Note:** The transfer charge code identifies one of 999 transfer fee codes in DDA fee specifications.
      description: Details of additional information used to add instructions for the fund transfer.
    XferModOperRequest_XferInfo_RefData:
      required:
        - RefType
      properties:
        RefType:
          type: string
          description: "Type of reference information used.\n\n\n\n**Note:** XferDesc refers to the description of the transfer. The description of the transfers is printed on reports, statement inquiries and customer notification.\n\n\n\n\n\n\n\nPayorDesc refers to the payor identification. \n\n\n\n\n\n\n\nPayeeDesc refers to a vendor number and only required if the external transfer account type is Vendor(BPM)."
          enum:
            - PayorDesc
            - XferDesc
            - PayeeDesc
            - TranCode
        RefDesc:
          maxLength: 1024
          type: string
          description: Description of the identifier.
        RefIdent:
          type: string
          description: Reference identifier value.
    XferModOperRequest_XferInfo:
      type: object
      properties:
        FromAcctRef:
          $ref: '#/components/schemas/XferModOperRequest_XferInfo_FromAcctRef'
        ToAcctRef:
          $ref: '#/components/schemas/XferModOperRequest_XferInfo_ToAcctRef'
        CurAmt:
          $ref: '#/components/schemas/XferModOperRequest_XferInfo_CurAmt'
        RecurModel:
          $ref: '#/components/schemas/XferModOperRequest_XferInfo_RecurModel'
        ExpediteInd:
          type: boolean
          example: false
        RelationshipMgr:
          type: array
          description: Information about the financial institution officers who have management-related responsibilities of the account.
          items:
            $ref: '#/components/schemas/XferModOperRequest_XferInfo_RelationshipMgr'
          example:
            - RelationshipMgrIdent: '201'
              RelationshipRole: 'Officer'
        ReportGroupCode:
          type: string
          description: "Client-defined code to group the accounts for reporting purposes.\n\n\n\n\n\n\n\n**Note:** Refers to the client-defined miscellaneous code that is used to group portfolios primarily as selection criteria for reporting. Values are 000-999. "
          example: '1'
        ExtendedXferData:
          $ref: '#/components/schemas/XferModOperRequest_XferInfo_ExtendedXferData'
        RefData:
          type: array
          description: Details of reference information used to correlate to transactions provided in bank statements.
          items:
            $ref: '#/components/schemas/XferModOperRequest_XferInfo_RefData'
          example:
            - RefType: TranCode
              RefIdent: '801'
            - RefType: PayeeDesc
              RefIdent: '0'
            - RefType: XferDesc
              RefDesc: 'MAX'
        LastXferDt:
          pattern: '[0-9]{4}-[0-9]{2}-[0-9]{2}(T[0-9]{2}:[0-9]{2}(:[0-9]{2}(\.[0-9]{3})?((-|\+)[0-9]{2}:[0-9]{2})?)?)?'
          type: string
          description: |-
            Date and time when the last transfer of funds occurred.
            Format: MM/DD/YYYY
            Example: 01/31/2021
          example: '2023-04-01'
        LastXferAmt:
          type: object
          description: Details of last transfer amount.
          properties:
            Amt:
              type: number
              description: Amount of the last transfer.
              example: 50
        RemainingOccurrences:
          type: integer
          description: Number of transfer occurrences that are pending
          format: int64
          example: 10
      description: Details of an automatic fund transfer.
    XferModOperResponse_XferStatusRec_XferKeys:
      required:
        - AcctKeys
      type: object
      properties:
        AcctKeys:
          $ref: '#/components/schemas/SecuredXferDelOperRequest_XferKeys_AcctKeys'
        XferIdent:
          maxLength: 36
          type: string
          description: |-
            Unique identifier of a transfer record.



            **Note:** Refers to the addenda number.
      description: Unique information to identify the transaction record.
    XferModOperResponse_XferStatusRec:
      required:
        - XferKeys
        - XferStatus
      type: object
      properties:
        XferKeys:
          $ref: '#/components/schemas/XferModOperResponse_XferStatusRec_XferKeys'
        XferStatus:
          $ref: '#/components/schemas/SecuredXferDelOperResponse_XferStatusRec_XferStatus'
      description: Details of the fund transfer status record in response to update operation.
